import React from 'react';

const QuoteItem = ({ quote: { value, tags } }) => {
  return (
    <div className='card' style={quoteStyle}>
      <p>{value}</p>
      <p style={{ fontSize: '0.7rem' }}>
        tags: <strong>{tags}</strong>
      </p>
    </div>
  );
};

const quoteStyle = {
  width: '70%',
  margin: '1rem auto',
  backgroundColor: 'green'
};

export default QuoteItem;
